script: |
  super -f text -I q8604.spq | sort > q8604.out

inputs:
  - name: q8604.spq
    data: |
      SELECT ALL - 41 FROM tab1 (FORMAT parquet) WHERE NOT col2 IN ( - col0 + col2 + 21, + ( + + col0 ) + - + col0, + + 86, + + 35 );
  - name: tab1

outputs:
  - name: q8604.out
    data: |
      -41
      -41
      -41
